export const PREVIOUS_PAGE = 'previous_page';
export const NEXT_PAGE = 'next_page';

export const previousPageAction = () => ({
    type: PREVIOUS_PAGE
})

export const nextPageAction = () => ({
    type: NEXT_PAGE
})
